(13743, 9872, 0, 1, '形隻影單', '', '2010-01-13 00:00:00', 0000, 0, 1, 4, '夜昏暗  燈一盞\r\n長夜漫漫  思念的舊疾復燃\r\n想念你  是我的萬靈丹\r\n\r\n日子苦短  喝了這一攤\r\n耳熱酒酣  紀念這一段情殤\r\n步履蹣跚  不怪你來遲姍姍\r\n\r\n像划著船  搖著槳  努力靠岸\r\n期待你畫好紅妝\r\n灑滿玫瑰花瓣  相遇在金黃沙灘\r\n\r\n如夢似幻的燦爛  原來一切\r\n都是我一廂情願的想像\r\n我們已經不在彼此身旁\r\n\r\n*科學麵  牛肉乾\r\n茶葉蛋  是我這一天的菜單\r\n沒了你  還有甚麼不能嚐?\r\n\r\n恨時間  不停歇\r\n把你帶離了我的身旁\r\n鳥獸散  轉眼我形隻影單\r\n\r\n像划著船  搖著槳  努力靠岸\r\n期待你畫好紅妝\r\n灑滿玫瑰花瓣  相遇在金黃沙灘\r\n\r\n如夢似幻的燦爛  原來一切\r\n都是我一廂情願的想像\r\n我們已經不在彼此身旁\r\n\r\nRAP\r\n1\r\n不算乖  也不壞  雖然不是木村拓哉\r\n還是有點帥  我不包二奶\r\n野花沒亂摘  為何愛情去去來來\r\n最後要說BYE?\r\n本來愛得赤裸  最後卻閃閃躲躲\r\n偷偷摸摸  應該含情脈脈卻眼神閃爍\r\n愛著了墨  卻斑駁掉落\r\n最後只能孤飲自酌  再把心  上了鎖  [solo ~ TO"*"]\r\n\r\n2\r\n還想牽你的手  感受你的溫柔\r\n徜徉在這一大片天空\r\n欲走還留  任憑一路顛簸\r\n但我無法強求\r\n只能任由你在我腦海穿梭\r\n我著了魔  我的愛只能這麼多 [solo]\r\n\r\n夜昏暗  燈一盞\r\n長夜漫漫  思念的舊疾復燃\r\n想念你  轉眼我形隻影單\r\n\r\n', '', 299, '', 'axom', 'axom', 'axom', '', '', 0, 0, 0, '2009-02-02 19:36:15', '2015-03-12 13:37:27', '0000-00-00 00:00:00'),
(13744, 9872, 0, 1, '有恁相挺', '', '2010-01-13 00:00:00', 0000, 0, 2, 7, '一時的失志 無算啥\r\n目屎吞落咱擱繼續拼\r\n有恁的相挺 感覺真快活\r\n卡大的困難 我嘛嘸驚\r\n\r\n命運的創治 無卡抓\r\n阮的路途 咱作伙行\r\n哪是未來 猶原是愛拖磨\r\n總未駛匿秋 做一個卒仔\r\n\r\n著算未來的路這歹行\r\n阮嘛要勇敢來拼輸贏\r\n我的理想尬願望\r\n大家目瞅金金塊看\r\n尚驚美夢醒來一場空\r\n\r\n一時的失志 無算啥\r\n目屎吞落咱擱繼續拼\r\n有恁的相挺 感覺真快活\r\n卡大的困難 我嘛嘸驚\r\n\r\n命運的創治 無卡抓\r\n阮的路途 咱作伙行\r\n哪是未來 猶原是愛拖磨\r\n有恁底身邊 做阮的靠山\r\n\r\n一杯苦酒飲落腹內去\r\n麥擱提起人生是為啥咪\r\n流著這一眠 男兒的珠淚\r\n天光後咱繼續來拼生死\r\n\r\n一杯苦酒飲落腹內去\r\n底這咧寂寞的暗眠\r\n看著天邊閃爍的彼粒星\r\n甘是塊尬阮講 不通放棄\r\n等待成功到來的彼一日\r\n', '', 257, '', '', '', '', '', '', 0, 0, 0, '2009-02-02 20:40:11', '2015-03-12 13:37:27', '0000-00-00 00:00:00'),
(13745, 184, 0, 1, 'Love The Way You Love', '', '0000-00-00 00:00:00', 0000, 0, 2, 7, '', '', 218, '', '', '', '', '', '', 0, 0, 0, '2009-02-02 21:17:53', '2015-03-12 13:37:27', '0000-00-00 00:00:00'),
(13746, 9872, 0, 1, '風鈴草', '', '2010-01-13 00:00:00', 0000, 0, 1, 4, '星夜下我恍惚的眼看著妳放浪形頦 \r\n\r\n也許妳的漂泊是個無奈 \r\n\r\n在妳墬落時來不及緊握 \r\n\r\n卻又任憑妳灑落這一地的溫柔 \r\n\r\n我撿拾不了這麼多 \r\n\r\n\r\n風吹著我不自主四處遊走 \r\n\r\n妳依然漂泊... \r\n\r\n此刻太陽仍舊昇起 \r\n\r\n我的距離對妳是另一顆星球 \r\n\r\n\r\n拾起了一株風鈴草 \r\n\r\n無顏交給妳... \r\n\r\n只因它的花語叫溫柔 \r\n\r\n\r\n抱歉牽了妳的手 \r\n\r\n卻藏起了我的心 \r\n\r\n', '', 157, '', 'axom', 'axom', 'axom', '', '', 0, 0, 0, '2009-02-02 21:40:11', '2015-03-12 13:37:27', '0000-00-00 00:00:00'),
(13747, 9889, 0, 1, 'Spilling Your Mind On The Moon', '', '0000-00-00 00:00:00', 0000, 10, 0, 3, '', '', 372, '', '', '', '', '', '', 0, 1, 0, '2009-02-03 00:38:13', '2015-03-12 13:37:27', '0000-00-00 00:00:00'),
