(13749, 6120, 1544, 1, '花椰菜之歌', '', '2008-07-01 00:00:00', 0000, 23, 0, 10, '1 花椰菜之歌\r\n詞曲:阿強/Durm：林昱安/Bass：冠伶/EG：陳顥、鐘語桐/AG：李奇明/Vo：阿強/Chorus：李奇明、陳顥、鄭光顯/Keyboard：小玉/錄音：阿勇/混音：雷堡\r\n\r\n不會放棄猴子 許多人的夢啊 \r\n夢中的那隻猴子 正在練吉他\r\n他點了點頭 看著天空 \r\n藍色和白色是今天的顏色\r\n\r\n晚餐吃咖哩 是我的主意\r\n但我不吃花椰菜 真是挑剔\r\n如果能夠再重來一次 世界從此改變\r\n我會選擇吃拉麵 男人的口味\r\n\r\n逃吧 來自藍區的卡車司機\r\n星夜裡沒有一個人在沙上\r\n游進大海裡在水裡 和魚群一起\r\n\r\n晚餐吃咖哩 是我的主意\r\n但我不吃花椰菜 真是挑剔\r\n如果能夠再重來一次 世界從此改變\r\n我會選擇吃拉麵 男人的口味\r\n', '', 275, '', '阿強', '阿強', '阿強', '角頭音樂', '', 1, 1, 0, '2009-02-03 01:30:51', '2015-03-12 13:37:27', '0000-00-00 00:00:00'),
(13750, 6120, 1544, 2, '時鐘裡的人', '', '2008-07-01 00:00:00', 0000, 23, 0, 10, '2 時鐘裡的人\r\n詞曲:阿強/Durm、Percussion：林昱安/Bass：冠伶/EG：陳顥/AG：李奇明/Vo：阿強/Chorus：李奇明/小喇叭、口琴：Charles McHale/錄音：阿勇/混音：雷堡\r\n\r\nBABE!我們住在時鐘裡 \r\nBABE!我在時針而你在分針\r\n時間! 時間過的如此遲緩 \r\nBABE!我在時針而你在分針\r\n\r\nBABE! 我們住在時鐘裡 \r\nBABE! 我在時針而你在分針\r\n慢慢地...時間歌頌著 慢慢地...分離的距離\r\n\r\nBABE!呼喚聲被齒輪蓋過 \r\nBABE!我希望能夠相信 發條仍在轉動\r\n時間 時間還在運轉 \r\nBABE!我希望能夠趁著秒針高空彈跳   \r\n\r\n拋拋!開開!時時!間間!的的!緩緩!慢慢!\r\n拋拋!開開!時時!間間!的的!緩緩!慢慢!\r\n', '', 393, '', '阿強', '阿強', '阿強', '角頭音樂', '', 1, 1, 0, '2009-02-03 01:43:16', '2015-03-12 13:37:27', '0000-00-00 00:00:00'),
(13751, 6120, 1544, 3, '跌進沉沉的夢', '', '2008-07-01 00:00:00', 0000, 23, 0, 10, '跌進沉沉的夢\r\n詞曲:阿強/Durm：林昱安/Bass：冠伶/EG：陳顥/AG：李奇明/Vo：阿強/Chorus：李奇明/錄音：阿勇/混音：虎神\r\n\r\n跌進沉沉的夢 到處都有人跑來跑去\r\n天空湖上水底 跑到哪裡都看得到人群\r\n虛偽的女人 寫那種虛偽的詩句\r\n妳的夢是假的 眼淚永遠不會滴在妳的心裡\r\n\r\n滿天都是煙霧 我們要去哪裡\r\n信封戒指蠟燭 離開卻沒帶走這些東西\r\n心碎的士兵 早就哭瞎了眼睛\r\n是不是等離開戰場 傷痕才會有人撫平\r\n\r\n亡命天涯的人才配的上妳高貴的心\r\n如果一切都這麼虛偽是跌進妳的夢裡\r\n曾經擁抱過的身體 那是唯一真實的東西\r\n\r\n跌進沉沉的夢 這次到處都是貓咪\r\n歐!瞎了眼的士兵  \r\n恩典讓你重現光明\r\n依神的旨意 寶貝讓我唱歌給妳聽\r\n我們一直擁抱下去 跌進沉沉的夢裡', '', 253, '', '阿強', '阿強', '阿強', '角頭音樂', '', 1, 1, 0, '2009-02-03 01:57:55', '2015-03-12 13:37:27', '0000-00-00 00:00:00'),
(13752, 6120, 1544, 4, '蟬的活力b', '', '2008-07-01 00:00:00', 0000, 23, 0, 10, '蟬的活力B\r\n詞曲:阿強/Durm、Percussion：林昱安/Bass：冠伶/EG：陳顥/AG：李奇明/Vo：阿強/Chorus：李奇明/Keyboard：小玉/錄音：阿勇/混音：虎神\r\n\r\n不能在空曠的地方旅行\r\n因為我總是回頭看什麼都看不見\r\n不能在空曠的地方旅行\r\n因為我會再也說不出來我回來了\r\n\r\n因為想把蚊子關在蠟燭裡\r\n所以想變成一隻蝴蝶在花園裡\r\n\r\n不能在空曠的地方旅行\r\n因為寂寞老是在我耳朵邊嘮叨\r\n不能在空曠的地方旅行\r\n因為我會忘記我自己的語言\r\n\r\n因為想把蚊子關在蠟燭裡\r\n所以想變成一隻蝴蝶在花園裡\r\n\r\n連星星也忘記方向\r\n連星星也忘記距離\r\n連星星也忘記思考\r\n連星星也不知道我在哪裡\r\n\r\n不能在空曠的地方旅行\r\n因為我不知道走到哪裡結束\r\n不能在空曠的地方旅行\r\n因為我的鬍子已經長到動物在裡面築巢\r\n\r\n因為想把自己關在籠子裡\r\n所以想變成一隻蝴蝶在花園裡\r\n\r\n飛吧我的愛\r\n飛吧我的愛', '', 212, '', '阿強', '阿強', '阿強', '角頭音樂', '', 1, 1, 0, '2009-02-03 02:03:50', '2015-03-12 13:37:27', '0000-00-00 00:00:00'),
(13753, 6120, 1544, 5, '說教人', '', '2008-07-01 00:00:00', 0000, 23, 0, 10, '說教人\r\n作詞:阿強、冠伶/作曲:阿強/Durm：林昱安/Bass：冠伶/EG：陳顥、鐘語桐/AG：李奇明/Vo：阿強/Chorus：李奇明/錄音：阿勇/混音：小處男\r\n\r\n選擇用肉體修行的方法渡河\r\n但是後來卻發現那根本是性慾\r\n\r\n不管你認不認真 或是了不了解\r\n你住的地方是不是迷宮\r\n都不會有人在乎\r\n\r\n一個在黑暗中卻明瞭世事的人\r\n他的心中也不一定有那一盞燈\r\n是憐憫也好 而他至少是快樂的(是你也好 至少我們還聽的見音樂)\r\n是你也好 從此以後我會一直牽你的手\r\n\r\n選擇用肉體修行的方法渡河\r\n牽著妳柔柔的手的方法如何\r\n選擇用肉體修行的方法渡河\r\n牽著妳柔柔的手的方法如何\r\n', '', 502, '', '阿強', '阿強', '阿強', '角頭音樂', '', 1, 1, 0, '2009-02-03 02:17:51', '2015-03-12 13:37:27', '0000-00-00 00:00:00'),
(13754, 6120, 1544, 6, '飛機上山', '', '2008-07-01 00:00:00', 0000, 23, 0, 10, '飛機上山\r\n詞曲:阿強/Durm：林昱安/Bass：冠伶/EG：陳顥、鐘語桐/AG：李奇明/Vo：阿強/Chorus：李奇明、陳顥、鄭光顯、林昱安、江依雯、李思緯/錄音：阿勇/混音：士玄\r\n\r\n飛機上山的時候我要知道 你不如躺著蹼!一聲破掉\r\n上山無論如何不可以飛 再找一個你也不像你自己\r\n\r\n淒涼的花苞忍受著冬天的傷 冬天的傷冷凍著酸著\r\n醒來的時候還沒到山頂 你說你要去吃冰 帶你的降落傘去\r\n告訴我你的咒語 告訴我你到底要去那裡\r\n不管飛到那裡你都不可以飛 飛到天上去弄得到處都是血\r\n\r\n我的飛機起火墮落 我的飛機起火墮落\r\n我的飛機起火墮落 我的飛機起火墮落\r\n\r\n飛機上山的時候我要知道 你不如躺著蹼!一聲破掉\r\n在飛機的外面要我原諒你 這傷口不會填平 我永遠不原諒你\r\n一個人有一點寂寞 多希望能夠彈著吉他唱個歌\r\n現在我的背上都是火焰 現在我看見地獄就在天堂的旁邊\r\n\r\n草原的盡頭交錯的地方 那裡有著粉紅色的寧靜\r\n無論是誰到那裡 都只會剩下二十公斤\r\n最後的毛也放棄掙扎 我的騎士騎著驢子戰鬥\r\n最後的連每個人都失去 自己連天空也看不見的甜\r\n', '', 242, '', '阿強', '阿強', '阿強', '角頭音樂', '', 1, 1, 0, '2009-02-03 02:24:47', '2015-03-12 13:37:28', '0000-00-00 00:00:00'),
(13755, 6120, 1544, 7, '參絞刑', '', '2008-07-01 00:00:00', 0000, 23, 0, 10, '參絞刑\r\n詞曲:阿強/Durm、Percussion：林昱安/Bass：冠伶/EG：陳顥/AG：李奇明/Vo：阿強/Chorus：李奇明/錄音：阿勇/混音：士玄\r\n\r\n空間裡的鵝跑得快\r\n聰明的人把房子蓋\r\n天空黑黑要把雨下\r\n刀光閃閃要把頭砍\r\n\r\n一顆一顆頭藏在騎士的馬後\r\n一雙一雙手掛在駱駝的駱峰\r\n一顆一顆頭藏在騎士的馬後\r\n一雙一雙手掛在駱駝的駱峰\r\n\r\n今天的胸毛我又忘了刮\r\n反正今天刮完明天又會長\r\n野豬吃完我又吃野狼\r\n我的名字就叫做殺人大魔王\r\n長茅關刀流星鎚 匕首銅鈸好折凳\r\n如果打棒球 我只打第四棒 棒子也是我拿手的強項\r\n\r\n媽媽.媽媽.媽媽　妳看妳看\r\n那個騎士的背上\r\n寶寶.寶寶.寶寶　你看你看\r\n那個駱駝的頭上\r\n那些肉塊都曾經在爸爸的背上\r\n那些肉塊都曾經在爸爸的背上\r\n\r\n那些肉塊都曾經在爸爸的背上\r\n那些肉塊都曾經在爸爸的背上\r\n媽媽.媽媽.媽媽…\r\n那些肉塊都曾經在爸爸的背上\r\n\r\n把我的錢拿走 把我的馬牽走\r\n不要再欺負我 我什麼都沒有\r\n\r\n讓我們來生把火 圍著營火拿起我們的高梁酒\r\nDJ 突然放起TECHNO 對面的小妞對我說哈囉\r\n我就這樣把他拉進了帳蓬 今晚讓我們來YO YO YO\r\nYO……', '', 238, '', '阿強', '阿強', '阿強', '角頭音樂', '', 1, 1, 0, '2009-02-03 02:31:48', '2015-03-12 13:37:28', '0000-00-00 00:00:00'),
(13756, 6120, 1544, 8, '乾耕的歲月', '', '2008-07-01 00:00:00', 0000, 23, 0, 10, '乾耕的歲月\r\n詞曲:阿強/Durm：林昱安/Bass：冠伶/EG：陳顥/AG：李奇明/Vo：阿強/Chorus：李奇明/錄音：阿勇/混音：虎神\r\n\r\n寂寞帶領我們進入乾耕的歲月\r\n在那裡我們摩擦腋下來生熱\r\n我需要一支火把開墾荒地\r\n在乾耕的歲月裡努力長毛\r\n\r\n長毛象在我身邊 野牛幫我耕田\r\n我喜歡吃兔子把皮扒下來做帽子\r\n孤單的我每天都和山羊聊天\r\n一個人坐在河邊看著月亮自慰\r\n\r\n寂寞帶領我們進入乾耕的歲月\r\n在那裡我們約定要逃到天涯海角\r\n我沒想到這麼殘酷你的命運\r\n在乾耕的歲月裡要去那裡?\r\n\r\n我有了自己的河 有自己的房子\r\n現在我可以命令森林起來跳舞\r\n孤單的我每天都和山羊聊天\r\n一個人坐在河邊看著月亮自慰\r\n\r\n因為沒有活人可以相信\r\n所以我開始相信神明\r\n我發現我看見了天使\r\n當我點燃菸捲的時候\r\n寂寞帶領我們進入乾耕的歲月\r\n天使開始出現在我的眼前', '', 232, '', '阿強', '阿強', '阿強', '角頭音樂', '', 1, 1, 0, '2009-02-03 02:38:46', '2015-03-12 13:37:28', '0000-00-00 00:00:00'),
(13757, 6120, 1544, 9, '甜蜜的酸黃瓜', '', '2008-07-01 00:00:00', 0000, 23, 0, 10, '甜蜜的酸黃瓜\r\n詞曲:阿強/Durm：阿鼓/Bass：冠伶/EG：陳顥/AG：李奇明/Vo：阿強/Chorus：李奇明、陳顥/錄音：虎神/TCM Studio/混音：虎神\r\n\r\n甜蜜的樹皮今天有點酸 令安特斯兄弟不禁退後三步\r\n甜蜜的香腸依然如故 前人用光屁股來明己志！！\r\n\r\n人並不是我殺的 我只有吃而已\r\n羊肉並不是我殺的 我只有切肉而已\r\n\r\n前面那個女孩其實長的不錯 我上去嘗了一口才知道有點酸\r\n\r\n飛越西伯利亞甜蜜的酸黃瓜！飛越西伯利亞甜蜜的酸黃瓜！\r\n飛越西伯利亞甜蜜的酸黃瓜！飛越西伯利亞甜蜜的酸黃瓜！', '', 142, '', '阿強', '阿強', '阿強', '角頭音樂', '', 1, 1, 0, '2009-02-03 02:43:03', '2015-03-12 13:37:28', '0000-00-00 00:00:00'),
(13758, 6120, 1544, 10, '野球狂之詩', '', '2008-07-01 00:00:00', 0000, 23, 0, 10, '野球狂之詩\r\n詞曲:阿強/Durm：林昱安/Bass：冠伶/EG：陳顥/AG：李奇明/Vo：阿強/鈴鼓、Chorus：李奇明/背景取樣:2001年世界盃棒球賽、2004年雅典奧運棒球賽現場轉播/錄音：阿勇/混音：阿勇\r\n\r\n有一顆星星掛在天上 不久便會墮落\r\n落在那片草原 火海佔據的草原\r\n輕輕地 燃燒著氧氣 就像手牽著手走過吊橋\r\n慢慢地 腐爛我身體 就讓我們永遠忘記\r\n\r\n看台上的人越來越少 同步飛過太平洋\r\n剩下的人一直在喊 為什麼你們要背叛\r\n我知道你的老闆很爛 而且這個聯盟大家都懶洋洋\r\n我知道也許有很多的理由 但是一切都來不及\r\n\r\n在那個連諾言也不值錢的時代\r\n你根本是個傻蛋\r\n你站在河邊看滿天的流星雨\r\n也會被隕石打死\r\n\r\n我也曾經憤怒但是我依然很著迷 \r\n我真的是個傻蛋\r\n這顆鑽石上有顆鋼鐵的心\r\n送給所有的野球迷\r\n\r\n在那個連諾言也不值錢的時代\r\n你根本是個傻蛋\r\n你站在河邊看滿天的流星雨\r\n也會被隕石打死', '', 441, '', '阿強', '阿強', '阿強', '角頭音樂', '', 1, 1, 0, '2009-02-03 02:56:06', '2015-03-12 13:37:28', '0000-00-00 00:00:00'),
