(13761, 162, 0, 1, '[Remix] - 不存在的女兒(GO Banana?)', '存在不是死的，而是活的、有生命的\r\n存在就是能自由地選擇不成為自己，或是選擇成為自己。\r\n\r\n我選擇了不成為我自己。\r\n\r\n選擇不成為自己較容易，\r\n因為我們習慣偽裝自己，\r\n隱藏自己內心真實的感受、去適應別人的期望；\r\n害怕真實的選擇會和這個世界發生衝突\r\n\r\n可是卻後悔了。', '0000-00-00 00:00:00', 0000, 0, 1, 3, 'you should be yourself; tomorrow will be fine\r\nalways be yourself..', '', 121, '', '', '', '', '', '', 1, 0, 0, '2009-02-03 14:45:25', '2015-03-12 13:37:28', '0000-00-00 00:00:00'),
(13762, 3181, 3150, 8, '1st album-降落傘', '', '2008-08-01 00:00:00', 0000, 15, 0, 7, '降落傘\r\n\r\n\r\n\r\n街上裝滿洶湧人群  找尋著 下一秒鐘的奇蹟\r\n每個人想若能重來  他一定 改變上天的決定\r\n所有的人缺乏耐性  卻認為 享受是一種權利\r\n不被遺忘的小藥瓶  裝滿著 拋開一切的情緒\r\n\r\n剎那間忘了彼此 忘了自己 究竟在哪裡?\r\n降落在亞麻色漩渦裡…\r\n就這樣忘了時間 忘了過去 未來在哪裡?\r\n我自己把我自己忘記…\r\n\r\n天旋地轉出現幻影 只有我 獨自看著這風景\r\n五光十色萬彩光映 環繞著 空無一物的心情\r\n所有蒼蠅突然離去 安靜地 沒留下任何命令\r\n訊號天線突然失靈 無回應 天空跟著下起雨\r\n', '', 210, '', '大雄', '大雄', 'KoOk', '獨立製作,喜瑪拉雅-代理發行', '', 1, 1, 0, '2009-02-03 15:32:42', '2015-03-12 13:37:28', '0000-00-00 00:00:00'),
