(13768, 9827, 0, 1, 'Rosewood Honey Trio-After That(After Reading Her Diary...)', '當然這不是我們團的Main Style拉\r\n是高三的時候 \r\n" 有感而發 " 的一曲\r\n\r\n套一句宇宙人樂團的用詞兒\r\n" 這是舊時代的產物 "\r\n\r\n不過是2009年的版本\r\n\r\n雖然沒有千年傳統 \r\n但也是全新感受呢\r\n\r\n\r\n顆顆', '0000-00-00 00:00:00', 0000, 0, 2, 1, '翻著我的回憶 \r\n心    又碎了一地               \r\n夏天    窗外的風卻 \r\n不再清新\r\n\r\n也許    若即若離 \r\n就是最美距離\r\n讓我無法前進 \r\n也不能放棄  \r\n\r\n愛 還在 \r\n或許 這就是所謂的 \r\n" 還有著期盼 不願離開 "\r\n我 想愛 \r\n到底 怎樣才能符合你的期待 \r\n別讓我再 \r\n傻傻等待\r\n\r\n\r\n假裝    毫不在意 \r\n你的一字一句\r\n慢慢    腐蝕著我 \r\n脆弱的    勇氣\r\n\r\n可能    你也忘記\r\n我的所有努力\r\n但    也許    \r\n有天    你也會想起\r\n\r\n愛 還在 \r\n或許 這就是所謂的 \r\n" 還有著期盼 不願離開 "\r\n我 想愛 \r\n到底 怎樣才能符合你的期待 \r\n別讓我再 \r\n傻傻等待', '', 236, '', '棠棠', '棠棠', '棠棠', 'Rosewood Honey Trio Inc.', '', 0, 0, 1, '2009-02-03 20:28:38', '2013-10-07 17:14:07', '0000-00-00 00:00:00'),
