(13770, 4986, 1216, 8, '【告別女孩日記】蔡呈菲鋼琴作品', '離開當小女孩的日子裡\r\n\r\n心裡永遠還是住著一個小女孩\r\n\r\n\r\n在成熟 懂事  與責任的年紀背後\r\n\r\n會偷偷的溜出來調皮與任性.........', '2011-07-19 00:00:00', 0000, 0, 2, 4, '', '', 231, '', 'JT', '', '', '', '', 0, 0, 0, '2009-02-04 02:43:00', '2015-03-12 13:37:28', '0000-00-00 00:00:00'),
