(13773, 4477, 0, 1, '約定', '2008  簡單生活節   創作音樂入選\n\nStreet Voice     編輯推薦音樂作品', '2008-05-01 00:00:00', 0000, 0, 1, 5, '春天花開那麼美麗，百花川迷人的風景\n踩著單車，穿過人群，那時也不覺得稀奇\n\n夏天夜晚中大湖畔，晚風吹在臉上好愜意\n仰望天空，群星閃爍，就這樣沉睡在美夢\n\n夕陽～伴著誠樸風景\n我們就在這相遇\n不管你在哪裡\n你是否曾忘記 是我們的約定\n\n我們曾 一起看著雲，沉浸在微風裡\n松樹下數著那些回憶\n那麼多悲傷\n那麼多歡喜\n要回到這裡，是我們離別前的約定\n\n\n秋天堆著落葉草皮，鐘聲迴響在角落裡\n涼涼的秋意，濃濃的記憶，是中大人共同的美麗\n\n冬季雙連坡上細雨，濕漉漉迷濛著霧氣\n忘了帶傘的那個下午，在大雨中狂奔事蹟\n\n夕陽～伴著誠樸風景\n我們就在這相遇\n不管你在哪裡\n你是否曾忘記 是我們的約定\n\n我們曾 一起看著雲，沉浸在微風裡\n松樹下數著那些回憶\n那麼多悲傷\n那麼多歡喜\n要回到這裡，是我們的約定\n我們曾 一起看著雲，沉浸在微風裡\n松樹下數著那些回憶\n那麼多悲傷\n那麼多歡喜\n要回到這裡，是我們離別前的約定\nDala dala dala ～～\nDala dala dala ～～\n', '', 230, '', '許巧宜', '許巧宜', '彭敬之', 'SdbS', '', 1, 0, 0, '2009-02-04 11:58:03', '2015-03-12 13:37:28', '0000-00-00 00:00:00'),
(13774, 388, 1545, 2, '傀儡咒', '', '2009-03-03 00:00:00', 0000, 20, 0, 7, '達啦啦.......啦...啦....\r\n西北方森林 流傳兩千年的箱底 刻著 傀儡的咒語\r\n你的背叛蔓延於血液 也寫下惡魔譜出的戀曲 嗚喔\r\n\r\n天空陪我哭一整夜 洗淨殘留的眷戀\r\n怨恨將指證所有思念\r\n用我黑色愛情血液 換你應得的壯麗\r\n霧與夜悄悄漫湧漸溢\r\n\r\n你驕傲的遊戲 就讓你去沉迷\r\n享受短暫甜蜜 再從天堂上掉入地獄\r\n跳完最終一首圓舞曲 就 一二三\r\n用舞步輕盈 步向壯烈悲劇\r\n\r\n用我黑色愛情血液 換你應得的壯麗\r\n霧與夜悄悄漫湧漸溢\r\n橘色艷陽被耗盡 染色黑白的大地\r\n愛意化成傀儡的利器\r\n\r\n可惜淒美悲劇 我無法去參與 \r\n西北方的森林 夜演奏著安魂曲 \r\n我閉上眼睛 嘴裡喃喃低語\r\n拉下鮮紅佈景 我用生命愛你的結局\r\n啦...', '', 258, '', '阿飛', 'Kiwi', '阿飛', '喜瑪拉雅', '', 1, 1, 0, '2009-02-04 11:58:12', '2015-03-12 13:37:28', '0000-00-00 00:00:00'),
(13775, 388, 1545, 3, '十月十四', '', '2009-03-03 00:00:00', 0000, 20, 0, 7, '又是落葉的季節 誰掀起從前\r\n打翻已塵封的思念\r\n才發現我還停在原點\r\n你往返流連 停在你逝去那一夜\r\n\r\n你答應我要牽著手看每個雪景\r\n一起去看盛夏的煙火季\r\n\r\n你的笑聲消失風裡 失去生命\r\n我的世界只剩下秋季\r\n\r\n風搖曳 悲侵襲 濺起了漣漪\r\n我在雨中心 宇宙裡 找你的氣息\r\n梅雨季 分不清 是淚還是雨\r\n凍結回憶裡 來不及說的那句唇語\r\n\r\n想追尋你的身影 到不再轉換的天氣\r\n想逃離沒你的冬季 今年秋季也長了些許', '', 238, '', '阿飛', 'Kiwi', '阿飛', '喜瑪拉雅', '', 1, 1, 0, '2009-02-04 11:59:18', '2015-03-12 13:37:28', '0000-00-00 00:00:00'),
(13776, 388, 1545, 4, 'Brushing Autumn Leaves', '', '2009-03-03 00:00:00', 0000, 0, 1, 7, '', '', 62, '', '', '', '', '', '', 1, 1, 0, '2009-02-04 11:59:39', '2015-03-12 13:37:28', '0000-00-00 00:00:00'),
(13777, 388, 1545, 5, '鋼琴與小步舞曲', '', '2009-03-03 00:00:00', 0000, 20, 0, 7, '黃昏襯托貴族式的野蠻	灑上多瑙河畔 投映雨後慵懶\r\n街角提琴手炫燿著平凡	Si Mi Re Do Si Do \r\n演奏著不平凡\r\n\r\n我轉個彎 長髮空中旋轉 我伸出手詢探那一絲的溫暖\r\n我輕輕嘆 輕敲黑白浪漫 音符城堡瀰漫 飛不出這絢爛\r\n\r\n獨舞著一圈一圈 輕踩著昨天	隨著仲夏夜	遠離的童年	\r\n獨奏著一遍一遍 孤單的知覺	我一點一點不見\r\n\r\nAs shadows cast upon the dim moonlight\r\nturned sweet sweet lullaby into a captive night\r\nI soar the sky, leave everything behind\r\ndiscover haven''s light beyond surreal disguise\r\n\r\n旋律裡誰看的見 囚困的音樂 繽紛的花園 佈滿了落葉\r\n我隨著音符穿越 華麗的鐵鍊 發現藍天依然遙遠\r\n\r\n獨舞著一圈一圈 輕踩著昨天 彈一遍一遍 孤單的知覺	\r\n窗外音符和世界纏繞出傳奇歌劇 我始終跳著一個人的小步舞曲\r\n\r\n**Repeat', '', 303, '', '阿飛', 'Kiwi', '阿飛', '喜瑪拉雅', '', 1, 1, 0, '2009-02-04 12:22:40', '2015-03-12 13:37:28', '0000-00-00 00:00:00'),
