(13780, 4477, 2138, 1, 'I Will Be There', 'SdbS前身- INDEX首張EP歌曲\r\n\r\nStreet Voice 編輯推薦音樂作品', '2007-05-01 00:00:00', 0000, 5, 0, 1, '不要說你最近多糟　It’s gonna be Okay.\r\n太陽下曬的正好  無處躲紫外線\r\n\r\n藍色的海到天邊  You better go to there.\r\n金色的沙灘上流連  跟煩惱說再見\r\n\r\n沒想過怎麼解脫　一切拋腦後\r\n就別再說　多難過\r\n收起不爽情緒跟著我\r\n\r\nI will be there 陪著你走過那些哀愁\r\n現在只需要享受陽光留下 黑色的詛咒\r\nSo common~ I will be there 替你吃掉所有的寂寞\r\n所有的情愛糾纏我都不管 只要藍色天空.\r\n', '', 197, '', '許巧宜', '許巧宜', '童志偉', 'INDEX', '', 1, 0, 0, '2009-02-04 15:03:32', '2015-03-12 13:37:28', '0000-00-00 00:00:00'),
(13781, 4477, 2138, 2, '墜落', 'SdbS前身- INDEX首張EP歌曲', '2007-05-01 00:00:00', 0000, 5, 0, 14, '風停了　雨走了　我沒不同　　　只剩人們說的解脫\r\n我不想聽　不願說　這種感受　　只是一時放棄結果\r\n\r\n所有的不理會　不想有悸動　　　拋開一切無理的念頭\r\n沒什麼　沒有痛　沒有理由　　　只能微笑看這混亂生活～\r\n\r\n都是你要的那種自由\r\n我看著自己無力的雙手　　　不能停下這結果\r\n全世界都看著一切毀滅　　　嘲笑著我的無力掙脫\r\nI DON’T CARE EVERYTHING GONNA BE WORSE.\r\n閉上眼輕輕墜落\r\n\r\nDON’T YOU KNOW　一切在墜落　　　還是一樣不願感受\r\n那些自以為是的念頭　　　BREAKING DOWN　我所有的理由\r\n', '', 280, '', '許巧宜', '許巧宜', '童志偉', 'INDEX', '', 1, 0, 0, '2009-02-04 15:04:03', '2015-03-12 13:37:28', '0000-00-00 00:00:00'),
(13782, 4477, 2138, 3, '一個人的灰色倫敦', 'SdbS前身- INDEX首張EP歌曲', '2007-05-01 00:00:00', 0000, 5, 0, 7, '灰色天空依然漂著雲   \r\n一個人的旅行沒有你\r\n看著窗外堆積的神秘\r\n就要帶著我飛向哪裡\r\n\r\n沒有悲傷沒有理由　只是想要飛走離開所有　\r\n追尋過的一切　全部通通拋走　一個人的旅行\r\nWithout You~~\r\n\r\n迷霧街頭陌生的臉孔 \r\n第三個飄雨的天空\r\n沉落在這潮濕的氣息\r\n就要帶走我無聲無息\r\n\r\n帶著誰的訊息飛向哪邊　不想知道誰的依戀\r\n在這沒有誰的城市　一個人的灰色秋天\r\n帶著誰的訊息飛向哪邊　不想知道誰的依戀\r\n在這沒有誰的城市　風吹不進　台北的落葉\r\n', '', 344, '', '許巧宜', '許巧宜', '童志偉', 'INDEX', '', 1, 0, 0, '2009-02-04 15:04:35', '2015-03-12 13:37:28', '0000-00-00 00:00:00'),
(13783, 4477, 2138, 4, '不要再說', 'SdbS 前身- INDEX 首張EP歌曲', '2007-05-01 00:00:00', 0000, 5, 0, 1, '你說我不該沒有目的浪費自己時間\r\n我應該翻開書本戴上眼鏡好好生活\r\n才能讓未來美好就像你一直所說\r\n我沒有逃避但是你忘了自己不是我\r\n\r\n或許我一是無成還是請你別管我\r\n我不需要你的那些編織美好的生活\r\n我想告訴你我會用自己想要的方式\r\n我沒有逃避但是請你記得別煩我\r\n\r\n不想再聽你說的 那些道理 我不是你\r\n別假裝你都懂 不想拆穿你 我是我自己\r\n\r\n不要再說什麼忘不掉規矩\r\nThat’s a pity\r\nGot your feeling\r\n不要再說什麼沒機會相信\r\nHey just do it\r\nFollow your willing\r\n\r\nDon’t say the word that in your mouth \r\nDon’t say the word that in your head\r\nI’ll show you what I believe in \r\nIt’s my faith\r\n', '', 236, '', '許巧宜', '許巧宜', '童志偉', 'INDEX', '', 1, 0, 0, '2009-02-04 15:05:15', '2015-03-12 13:37:28', '0000-00-00 00:00:00'),
(13784, 4477, 0, 5, 'Rainy Night', '中央大學熱音社- 第一張創作合輯歌曲', '2006-09-10 00:00:00', 0000, 0, 1, 4, '天快亮了　還沒睡醒　今天又是星期幾\r\n眼睛上的黑眼圈　他提醒著我想著你\r\n窗外滴滴的雨水　讓我想起了那夜裡\r\n那些傷人的話語　陣陣啃蝕著我的心\r\n\r\nOh～ It’s a rainy night.　 Da～\r\nOh～ It’s a rainy night～\r\n\r\n無法控制的憂鬱就這樣一直在心底\r\n我的小小悲哀放肆在每一分每秒裡\r\n忽然間想起了你曾經說的那些話\r\n為何總忘不掉那悲傷\r\nOh baby 想你 想你 想你 Ah~~~\r\n\r\n看著你留下的訊息說著你也許想著她\r\n看著你現在的臉可能你已經忘了吧\r\n不想承認我沒有辦法把這件事情通通忘掉\r\n在每一個rainy night重複說著我的傷\r\n\r\n無法控制的憂鬱就這樣一直在心底\r\n我的小小悲哀放肆在每一分每秒裡\r\n數著那些往事就像你從來沒有離去\r\n面對你的雙眼　清晰看見所有一切空虛\r\n\r\n無法控制的憂鬱就這樣一直在心底\r\n我的小小悲哀放肆在每一分每秒裡\r\n忽然間想起了你曾經說的那些話\r\n為何總忘不掉那悲傷\r\nOh baby 想你 想你 想你 Ah~~~\r\n', '', 290, '', '許巧宜', '許巧宜', 'INDEX', 'SdbS', '', 1, 0, 0, '2009-02-04 15:05:44', '2015-03-12 13:37:28', '0000-00-00 00:00:00'),
